    "big-muddy-national-fish-and-wildlife-refuge-fiscal-year-2005-annual-narrative-report",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Big Muddy
    National Fish and Wildlife Refuge summarizes refuge activities during the fiscal
    year 2005.  The report begins with an introduction to the refuge and a summary of
    the yearu2019s highlights and climatic conditions.  Information about monitoring
    and studies- including fisheries and hydrology surveys are provided next.  Habitat
    restoration and management projects are also covered including wetland and riverine
    restoration.  Fish and wildlife management is discussed next with emphasis on bird
    banding, disease monitoring and predator control.  Coordination activities with
    Interagency groups and Friend's Organizations are outlined.  The resource protection
    section provides information about law enforcement, water rights, land acquisition,
    and wilderness areas.  Information about public education and recreation is given
    including visitor services and refuge visitation.  Finally, refuge planning and
    administration are discussed.",nt"license_title": "License Not Specified",nt"extras":
